// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract BlindAuction {
    struct Bid {
        bytes32 blindedBid; // 블라인드 입찰값
        uint deposit; // 입찰 보증금
    }

    // 경매 단계 정의
    enum Phase {Init, Bidding, Reveal, Done}

    // 경매 주최자
    address payable public beneficiary;

    // 최고 입찰자 및 최고 입찰가 추적
    address public highestBidder;
    uint public highestBid = 0;

    // 각 주소의 입찰 정보
    mapping(address => Bid) public bids;
    mapping(address => uint) pendingReturns;

    // 현재 경매 단계
    Phase public currentPhase = Phase.Init;

    // 이벤트 정의
    event AuctionEnded(address winner, uint highestBid);
    event BiddingStarted();
    event RevealStarted();
    event AuctionInit();

    // 생성자
    constructor(address payable _beneficiary) {
        beneficiary = _beneficiary; // 경매 주최자 설정
        emit AuctionInit();
    }

    // 경매 단계 전환 함수
    function advancePhase() public {
        require(msg.sender == beneficiary, "Only the beneficiary can advance the phase.");
        require(currentPhase != Phase.Done, "Auction already ended.");

        if (currentPhase == Phase.Init) {
            currentPhase = Phase.Bidding;
            emit BiddingStarted();
        } else if (currentPhase == Phase.Bidding) {
            currentPhase = Phase.Reveal;
            emit RevealStarted();
        } else if (currentPhase == Phase.Reveal) {
            currentPhase = Phase.Done;
            emit AuctionEnded(highestBidder, highestBid);
        }
    }

    // 입찰 함수
    function bid(bytes32 blindBid) public payable {
        require(currentPhase == Phase.Bidding, "Bidding is not active.");
        require(msg.value > 0, "Bid amount must be greater than 0.");
        require(bids[msg.sender].deposit == 0, "You have already placed a bid.");

        // 새로운 입찰 정보 저장
        bids[msg.sender] = Bid({
            blindedBid: blindBid,
            deposit: msg.value
        });

        // 최고 입찰가 갱신
        if (msg.value > highestBid) {
            highestBid = msg.value;
            highestBidder = msg.sender;
        }
    }

    // 입찰 공개 함수
    function reveal(uint value, bytes32 secret) public {
        require(currentPhase == Phase.Reveal, "Reveal phase is not active.");
        Bid storage bidToCheck = bids[msg.sender];

        require(bidToCheck.deposit > 0, "No bid found.");
        require(bidToCheck.blindedBid == keccak256(abi.encodePacked(value, secret)), "Invalid reveal.");

        // 입찰 공개
        if (value > highestBid) {
            highestBid = value;
            highestBidder = msg.sender;
        }

        // 입찰 정보 삭제
        delete bids[msg.sender];
    }

    // 낙찰금 전송 함수
    function withdraw() public {
        require(currentPhase == Phase.Done, "Auction not yet ended.");
        require(msg.sender != highestBidder, "Highest bidder cannot withdraw.");

        uint amount = pendingReturns[msg.sender];
        require(amount > 0, "No funds to withdraw.");

        pendingReturns[msg.sender] = 0; // 재진입 방지
        payable(msg.sender).transfer(amount);
    }

    // 경매 종료 및 낙찰금 전송
    function auctionEnd() public {
        require(currentPhase == Phase.Done, "Auction not yet ended.");
        require(msg.sender == beneficiary, "Only the beneficiary can end the auction.");

        beneficiary.transfer(highestBid); // 최고 입찰가를 주최자에게 전송
    }
}

